import Head from "next/head";
import Navbar from "./Navbar";

const Layout = (props) => {
  return (
    <>
      <Head>
        <title>To Do App</title>
        <link
          rel="stylesheet"
          href="https://bootswatch.com/4/cerulean/bootstrap.min.css"
        />
      </Head>
      {/* <Navbar /> */}
      <div style={{ height: "100vh", background: "#060b1e" }}>
        <h3>To Do App</h3>
        <p>by Jericho Aldemo</p>
        {props.children}
      </div>
    </>
  );
};

export default Layout;
